import React, { Component } from "react";
import "./Node.css";

class Node extends Component {
  render() {
    const { row, column, isStart, isFinish, isWall } = this.props;
    const specialName = isFinish
      ? "finish"
      : isStart
      ? "start"
      : isWall
      ? "wall"
      : "";
    return <div className={`node${specialName}`}></div>;
  }
}
export default Node;
